import React from "react";
import "./NavBar.css";
function NavBar() {
  return (
    <div>
      <div class="navbar">
       <div className="navbar_info"></div>
        <a href="#home">Product</a>
        <a href="#about">Template</a>
        <a href="#services">Pricing</a>
        <a href="#contact">Blog</a>
        <a href="#contact">Sign in</a>
      </div>
    </div>
  );
}

export default NavBar;
